script: |
  super -f text -I q8562.spq | sort > q8562.out

inputs:
  - name: q8562.spq
    data: |
      SELECT DISTINCT 12 AS col1 FROM tab0 (FORMAT parquet) WHERE - col1 NOT BETWEEN - + col1 * 80 * + 91 * + ( - col0 ) + col1 + col0 AND NULL;
  - name: tab0

outputs:
  - name: q8562.out
    data: |
      12
